import React, { useState, useEffect } from 'react';
import { Table, Button, Modal, Spinner } from 'react-bootstrap';
import ServicioForm from './ServicioForm'; // Asegúrate de que la ruta sea correcta

const ServicioPage = () => {
  const [servicios, setServicios] = useState([]);
  const [selectedServicio, setSelectedServicio] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simula una llamada a la API para obtener los servicios
    const fetchServicios = async () => {
      try {
        // Aquí deberías reemplazar esto con una llamada a tu API
        const response = await fetch('/api/servicios');
        const data = await response.json();
        setServicios(data);
      } catch (error) {
        console.error('Error fetching servicios:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchServicios();
  }, []);

  const handleShowModal = (servicio) => {
    setSelectedServicio(servicio);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedServicio(null);
    setShowModal(false);
  };

  const handleSave = async (servicio) => {
    try {
      if (servicio.id) {
        // Actualizar servicio existente
        await fetch(`/api/servicios/${servicio.id}`, {
          method: 'PUT',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(servicio),
        });
      } else {
        // Agregar nuevo servicio
        await fetch('/api/servicios', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(servicio),
        });
      }

      // Actualizar la lista de servicios
      const response = await fetch('/api/servicios');
      const data = await response.json();
      setServicios(data);

      handleCloseModal();
    } catch (error) {
      console.error('Error saving servicio:', error);
    }
  };

  const handleAdd = () => {
    setSelectedServicio(null);
    setShowModal(true);
  };

  return (
    <div>
      <Button variant="primary" onClick={handleAdd}>
        Agregar Servicio
      </Button>

      {loading ? (
        <Spinner animation="border" />
      ) : (
        <Table striped bordered hover className="mt-3">
          <thead>
            <tr>
              <th>Nombre</th>
              <th>Descripción</th>
              <th>Precio</th>
              <th>Fecha de Cita</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {servicios.map((servicio) => (
              <tr key={servicio.id}>
                <td>{servicio.nombre}</td>
                <td>{servicio.descripcion}</td>
                <td>{servicio.precio}</td>
                <td>{servicio.fechaCita}</td>
                <td>
                  <Button variant="warning" onClick={() => handleShowModal(servicio)}>
                    Editar
                  </Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      )}

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>{selectedServicio ? 'Editar Servicio' : 'Agregar Servicio'}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <ServicioForm servicio={selectedServicio} onSave={handleSave} />
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Cerrar
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default ServicioPage;
